import React, { useState } from "react";
import { BrowserRouter as Router, Link } from "react-router-dom";

import logo from "./logo.svg";

import "./App.css";

function Head(props) {
  var [navBar, setPos] = useState(false);

  function menuNavBar() {
    var setValue = 1;

    if (navBar === false) {
      document.getElementById("menu").style.display = "initial";
      document.getElementById("header").style.backgroundColor = "rgba(250, 250, 250, 1)";
      document.getElementById("hamburg").style.color = "rgba(50, 0, 180, 0.9)";



      setPos(true);
    } else {
      document.getElementById("menu").style.display = "none";
      document.getElementById("header").style.backgroundColor = "transparent";
      document.getElementById("hamburg").style.color = "rgba(250, 250, 250, 1)";



      // document.getElementById("menu").style.height = "2";
      setPos(false);
    }
  }
  window.onscroll = function(){
    scrollFunction()
  };
// document.body.scrollTop > 1 or
  function scrollFunction(){
    if( document.documentElement.scrollTop > 5){
      document.getElementById("header").style.backgroundColor = "rgba(250, 250, 250, 0.9)";
      document.getElementById("hamburg").style.color = "rgba(50, 0, 180, 0.9)";

    }else{
      document.getElementById("header").style.backgroundColor = "transparent";
      document.getElementById("hamburg").style.color = "white"

    }
    if(document.documentElement.scrollTop > 200){
      document.getElementById("header").style.boxShadow = "2px 1px 8px rgba(10, 10, 10, 0.5), 2px 2px 0px white";
    }else{
      document.getElementById("header").style.boxShadow = "none";

    }
  }

  return (
    <div>
      <div className="header-bar">
        <header className="headerg" id="header">
          <div className="logo">
            <span className="logo1">
              <i className="fa copyRight"></i>
            </span>
            <span className="logo2">SKILLS</span>
          </div>
          <div className="hd-col">
            <Link to="/" className="hd">
              HOME
            </Link>
            <Link to="/aboutus/" className="hd">
              ABOUT US
            </Link>
            <Link to="/blog/" className="hd">
              BLOG
            </Link>
            <Link to="/developer/" className="hd">
              DEVELOPER
            </Link>
          </div>
          <div className="hamburg" id="hamburg" onClick={menuNavBar}>
            <i className="fa fa-bars" style={{ fontSize: "2em" }}></i>
          </div>
        </header>
        <div className="menu" id="menu">
          <div className="navbar fadeInNav" id="navbar">
            <div className="nav-in fadeIn">
              <div>
                <Link to="/" className="hdm home">
                  HOME
                </Link>
              </div>
              <div>
                <Link to="/aboutus/" className="hdm">
                  ABOUT US
                </Link>
              </div>
              <div>
                <Link to="/blog/" className="hdm">
                  BLOG
                </Link>
              </div>
              <div>
                <Link to="/developer/" className="hdm">
                  DEVELOPER
                </Link>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Head;
